async function ratkaise(){const t=[[null,null,null],[null,null,null],[null,null,null]];document.querySelectorAll(".cell").forEach(((e,n)=>{const l=Number(e.textContent.match(/\d+/)[0]),a=[e.getAttribute("data-position")[0],e.getAttribute("data-position")[1]];t[a[0]][a[1]]=l})),console.clear(),alert("Käytetään algoritmia ratkaisun selvittämiseksi. Klikkaa jatkaaksesi."),await fetch("http://localhost:5000/solve",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({INTIAL_STATE:t})}).then((t=>t.json())).then((t=>{t.forEach(((t,e)=>{for(let n=0;n<t.length;n++)for(let l=0;l<t[n].length;l++)if(null===t[n][l]){setTimeout((()=>{document.querySelector(`.cell[data-position="${n}${l}"]`).dispatchEvent(new Event("mousedown"))}),150*e);break}})),setTimeout((()=>{alert("Valmis!")}),150*(t.length+1))}))}document.addEventListener("keydown",(async function(t){"F2"===t.key&&await ratkaise()})),window.addEventListener("load",(()=>{alert("Voit käyttää F2-näppäintä ratkaisun selvittämiseen.")}));